import styled from 'styled-components'

const BoxsedButton = styled.button`
    width: 160px;
    height: 60px;
    background: #fff;
    cursor: pointer;
    margin-bottom: 30px;
    border: none;
    font-weight: bold;

`;

export default BoxsedButton
